import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import axios from "axios";

function Logado({ userName }) {
  const navigate = useNavigate();
  const [usuario, setUsuario] = useState("");
  const clinics = [
    {
      id: 1,
      name: "Clinic A",
      location: "Recife",
      imageUrl: "clinic-a.jpg",
    },
    {
      id: 2,
      name: "Clinic B",
      location: "Recife",
      imageUrl: "clinic-b.jpg",
    },
    {
      id: 3,
      name: "Clinic C",
      location: "Recife",
      imageUrl: "clinic-c.jpg",
    },
  ];

  useEffect(() => {
    async function verificar() {
      try {
        const response = await axios.get("http://localhost:5000/inicio", {
          headers: {
            Authorization: localStorage.getItem("token"),
          },
        });
        if (response.status === 401) {
          navigate("/");
        }
      } catch (error) {
        console.error(error);
        navigate("/");
      }
    }

    verificar();
  }, [navigate]);

  return (
    <div className="landing-page">
      <div className="hero">
        <img src="./img/background.jpg" alt="Background" className="background-image" />
        <h1 className="welcome-message">Olá, {userName}!</h1>
        <p className="landing-text">Seja bem-vindo(a) ao Clinic Finder. Aqui você encontra informações sobre as principais clínicas de Recife.</p>

        <div className="card-container">
          <Link to="/search" className="card">
            <img src="./img/card1.jpg" alt="Card 1" />
            <h2 className="card-title">Encontre Clínicas</h2>
            <p className="card-description">Encontre clínicas na sua região e obtenha informações detalhadas.</p>
          </Link>

          <Link to="/services" className="card">
            <img src="./img/card2.jpg" alt="Card 2" />
            <h2 className="card-title">Serviços Oferecidos</h2>
            <p className="card-description">Explore os serviços oferecidos pelas clínicas e encontre o que você precisa.</p>
          </Link>

          <Link to="/contact" className="card">
            <img src="./img/card3.jpg" alt="Card 3" />
            <h2 className="card-title">Entre em Contato</h2>
            <p className="card-description">Entre em contato com as clínicas diretamente para agendar consultas ou obter mais informações.</p>
          </Link>
        </div>

        <div className="clinic-cards">
          <h2 className="section-title">Principais Clínicas de Recife</h2>
          {clinics.map((clinic) => (
            <ClinicCard key={clinic.id} clinic={clinic} />
          ))}
        </div>

        <div className="social-icons">
          <h3 className="title">Nossas Redes Sociais</h3>
          <a href="https://www.instagram.com/clinicfinder" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-instagram"></i>
          </a>
          <a href="https://www.facebook.com/clinicfinder" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-facebook"></i>
          </a>
          <a href="https://www.twitter.com/clinicfinder" target="_blank" rel="noopener noreferrer">
            <i className="fab fa-twitter"></i>
          </a>
        </div>

        <p className="contact-info">Telefone: (81) 3252-5569</p>
      </div>
    </div>
  );
}

export default Logado;
